import "./searchItem.css";

const SearchItem = () => {
  return (
    <div className="searchItem">
      <img
        src="https://www.ahstatic.com/photos/5451_ho_00_p_1024x768.jpg"
        alt=""
        className="siImg"
      />
    </div>
  );
};

export default SearchItem;
